import React from 'react';
import './login.css';

const Login = ({loginControll})=>{
    return(
        <div className="login-container">
            <form >
                <input className="login-input" type="text" required placeholder="username ..." />
                <input className="login-input" type="text" required placeholder="password ..." />
                <input type="submit" value="login" className="login-btn" onClick={loginControll}/><button className="login-btn">signin</button>
            </form>
        </div>
    );
}

export default Login;
